import React from 'react'
import Sidebar from './Sidebar';
import OpenConversation from './OpenConversation';
import { useConversations } from '../contexts/ConversationsProvider';
import api from '../api'

// Main
export default function Dashboard({ id }) {
  const { selectedConversation } = useConversations()

  api.getAllUsers().then(users => {
    console.log(users.data.data);
  })

  /*
  var pseudo = "test1";
  var id_user = "5025600560069600";
  const payload = { pseudo, id_user }
  api.insertUser(payload).then(res => {
      window.alert(`User inserted successfully`);
  })*/

  return (
    <>
      <Sidebar id={id} />
      <div className="container">
        {
          selectedConversation !== undefined ?
            selectedConversation && <OpenConversation />
            :
            <div className="welcome">
              <div className="welcome-title">
                Bienvenue sur FInt.Tchat
              </div>
              <div className="welcome-content">
                Pour ajouter un contact il faut cliquer sur le petit + a cot√© de contacts,
                puis entrer son id et cliquez sur ajouter
              </div>
            </div>
        }
      </div>
    </>
  )
}
